import React from 'react'

function TextBox(props){

    const state = {
        text: 'T채m채 on default teksti!'
    }
    
    return(
        <div className="offset-1">
            <h1>{state.text}</h1>
            <div>
                <input type='text'/>
            </div>
            <div>
                <button>Vaihda Teksti</button>
            </div>
        </div>
    )
}

export default TextBox
